import React, {Component} from 'react';

class ProductList extends Component {
    render() {
        return (
            <React.Fragment>
                <div className="py-4">
                    <div className="container">
                        <div className="row"></div>
                    </div>
                </div>
                <div className="col-6 black">
                    <div>
                        <input id="flyingfrom" className="flyingfrom col-6" type="text" name="" placeholder="flying from" />
                        <input id="flyingto" className="flyingto col-6" type="text" name="" placeholder="flying to" />
                    </div>
                    <div>
                        <input id="departing"  className="departing" type="text" name="" placeholder="departing" />
                        <input id="returning" className="returning" type="text" name="" placeholder="returning" />
                    </div>
                    <input id="searchButton" type="button" value="Search" />
                </div>
            </React.Fragment>
        );
    }
}

export default ProductList;
